import React from "react";
import "../../styles/Dashboard.css";
import { Card } from "@/components/ui/card";
import { Button } from "@/components/ui/button";

const StudentDashboard = () => {
  const mockCourses = [
    { id: 1, title: "Machine Learning", progress: 75 },
    { id: 2, title: "Web Development", progress: 50 },
    { id: 3, title: "Data Science", progress: 90 },
  ];

  const mockRecommendations = [
    "Introduction to AI",
    "Blockchain Basics",
    "Advanced React Techniques",
  ];

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <h2>Dashboard</h2>
        <ul>
          <li>My Courses</li>
          <li>Recommendations</li>
          <li>Learning Activity</li>
          <li>Settings</li>
        </ul>
      </div>
      <div className="main-content">
        <h1>Welcome Back!</h1>
        <section className="courses-section">
          <h2>My Courses</h2>
          <div className="courses-list">
            {mockCourses.map((course) => (
              <Card key={course.id} className="course-card">
                <h3>{course.title}</h3>
                <div className="progress-bar-container">
                  <div
                    className="progress-bar"
                    style={{ width: `${course.progress}%` }}
                  ></div>
                </div>
                <p>{course.progress}% completed</p>
                <Button className="view-course-button">View Course</Button>
              </Card>
            ))}
          </div>
        </section>

        <section className="recommendations-section">
          <h2>Recommended for You</h2>
          <ul>
            {mockRecommendations.map((rec, index) => (
              <li key={index} className="recommendation-item">
                {rec}
              </li>
            ))}
          </ul>
        </section>

        <section className="activity-section">
          <h2>Recent Learning Activity</h2>
          <p>You spent 3 hours learning Machine Learning this week.</p>
        </section>
      </div>
    </div>
  );
};

export default StudentDashboard;
